const Logo = () => (
    <div>
        <div>
            <h2 className="logo">JAI PARAKH</h2>
            <p className="logo logo-desc">Fullstack Developer | Mentor | Jedi</p>
        </div>
        <style jsx>{`
            .logo{
                font-size: 4rem;
                font-family: 'Abril Fatface';
                border-bottom: 2px solid #fff;
            }
            .logo-desc{
                font-size: 1.2rem;
            }
        `}</style>
    </div>
)

export default Logo;
